        val adapter1=PostAdapter(lstPost,this)
        cycle2.layoutManager=LinearLayoutManager(this)
        cycle2.adapter=adapter1;
        val intent=Intent()
        if(intent.extras!=null){
            name=intent.getStringExtra("name").toString()
            img=intent.getStringExtra("img").toString()
            cid=intent.getStringExtra("cid").toString()
        }
    }

    override fun onActivityResult(requestCode: Int, resultCode: Int, data: Intent?) {
        super.onActivityResult(requestCode, resultCode, data)
        if(requestCode==1){
            if(resultCode== Activity.RESULT_OK) {
                var post= data?.getParcelableExtra<ExtraPost>("Extrapost")
                extrapost.add(post!!)
                img1=extrapost.get(0).img.toString()
                st=extrapost.get(0).status.toString()
                lstPost.add(post(1,
                    "$img",
                    "$name",
                    "$img1",
                    "500 likes",
                    "$st"
                ))
                cycle2.adapter?.notifyDataSetChanged()
                lstPost.reverse()
            }
        }    }
